import React from "react";

export default function ProfileContent({ profile }) {
  const languages = profile.languages.map((lang, index) => (
    <li key={index}>{lang}</li>
  ));
  const interestedIn = profile.interestedIn.map((lang, index) => (
    <li key={index}>{lang}</li>
  ));
  const hobbies = profile.hobbies.map((hobby, index) => (
    <li key={index}>{lang}</li>
  ));

  return (
    <div>
      <div className="fixed-action-btn">
        <a
          href="#"
          className="hoverable waves-effect btn-floating btn-large red"
        >
          <i className="large material-icons">mode_edit</i>
        </a>
      </div>
      <img src={profile.avatar} alt="profile avatar" className="profile-img" />
      <h4>{profile.user.name}</h4>
      <div className="cards">
        <div className="card small">
          <div className="card-content">
            <h5>Languages Spoken</h5>
            <ul>{languages}</ul>
          </div>
        </div>
        <div className="card small">
          <div className="card-content">
            <h5>Interested in Languages</h5>
            <ul>{interestedIn}</ul>
          </div>
        </div>
        <div className="card small">
          <div className="card-content">
            <h5>Hobbies</h5>
            <ul>{hobbies}</ul>
          </div>
        </div>
      </div>
    </div>
  );
}
